{"id":"srcSearchRoutesQuery","query":"query srcSearchRoutesQuery(
  $feeds: [String!]!
  $name: String
  $modes: [Mode]
) {
  viewer {
    routes(feeds: $feeds, name: $name, transportModes: $modes) {
      gtfsId
      agency {
        name
        id
      }
      competentAuthority
      type
      shortName
      mode
      longName
      patterns {
        code
        id
      }
      id
    }
  }
}
","variables":{"feeds":["estonia","elron"],"name":"$_1","modes":null}}
